insert  into `sys_log`(`ID`,`USERNAME`,`OPERATION`,`TIME`,`METHOD`,`PARAMS`,`IP`,`CREATE_TIME`,`location`,`status`,`type`) values (2116,'admin','insert操作系统日志','11','com.rains.graphql.system.mutation.NoticeMutation.noticeBaseMutation()',' request: \"QueryRequest(runOrder=0, pageSize=10, pageNum=1, sortField=null, sortOrder=desc, filter=null, opt=insert, svc=null, ids=null, data=null, datas=[{noticeTitle=test1, noticeType=1, noticeContent=<h2>filter() - 过滤,筛选</h2><p class=\\\"ql-align-right\\\">1</p><p><code style=\\\"color: rgb(0, 0, 255); background-color: initial;\\\">var</code>&nbsp;<code style=\\\"color: rgb(0, 0, 0); background-color: initial;\\\">newArr = array.filter((currentValue, index, array) =&gt; {&nbsp;</code><code style=\\\"color: rgb(0, 0, 255); background-color: initial;\\\">return</code>&nbsp;<code style=\\\"color: rgb(0, 0, 0); background-color: initial;\\\">... }, thisValue);</code></p><ul><li>currentValue， 必须，当前的元素值；</li><li>index， 可选，当前元素值的索引；</li><li>array， 可选，原数组；</li><li>thisValue， 可选，对象作为该执行回调时使用，传递给函数，用作 \\\"this\\\" 的值；</li><li>return 新数组；</li></ul><p>栗子：过滤不符合项</p><p class=\\\"ql-align-right\\\">1</p><p class=\\\"ql-align-right\\\">2</p><p class=\\\"ql-align-right\\\">3</p><p class=\\\"ql-align-right\\\">4</p><p class=\\\"ql-align-right\\\">5</p><p><code style=\\\"color: rgb(0, 0, 255); background-color: initial;\\\">var</code>&nbsp;<code style=\\\"color: rgb(0, 0, 0); background-color: initial;\\\">arr = [20,30,50, 96,50]</code></p><p><code style=\\\"color: rgb(0, 0, 255); background-color: initial;\\\">var</code>&nbsp;<code style=\\\"color: rgb(0, 0, 0); background-color: initial;\\\">newArr = arr.filter(item =&gt; item&gt;40)&nbsp;</code></p><p>&nbsp;</p><p><code style=\\\"color: rgb(0, 0, 0); background-color: initial;\\\">console.log(arr)&nbsp;&nbsp;</code><code style=\\\"color: rgb(0, 130, 0); background-color: initial;\\\">// [20,30,50, 96,50]</code></p><p><code style=\\\"color: rgb(0, 0, 0); background-color: initial;\\\">console.log(newArr)&nbsp;&nbsp;</code><code style=\\\"color: rgb(0, 130, 0); background-color: initial;\\\">// [50, 96, 50]</code></p><p>&nbsp;</p><p>高频用途：</p><ol><li>上例中的过滤不符合项；</li><li>去掉数组中的&nbsp;<span style=\\\"color: rgb(255, 0, 0);\\\">空字符串、0、</span>undefined、null；</li><li class=\\\"ql-align-right\\\">1</li><li class=\\\"ql-align-right\\\">2</li><li class=\\\"ql-align-right\\\">3</li><li class=\\\"ql-align-right\\\">4</li><li class=\\\"ql-align-right\\\">5</li><li><code style=\\\"color: rgb(0, 0, 255); background-color: initial;\\\">var</code>&nbsp;<code style=\\\"color: rgb(0, 0, 0); background-color: initial;\\\">arr = [</code><code style=\\\"color: rgb(0, 0, 255); background-color: initial;\\\">\'1\'</code><code style=\\\"color: rgb(0, 0, 0); background-color: initial;\\\">,&nbsp;</code><code style=\\\"color: rgb(0, 0, 255); background-color: initial;\\\">\'2\'</code><code style=\\\"color: rgb(0, 0, 0); background-color: initial;\\\">,&nbsp;</code><code style=\\\"color: rgb(0, 0, 255); background-color: initial;\\\">null</code><code style=\\\"color: rgb(0, 0, 0); background-color: initial;\\\">,&nbsp;</code><code style=\\\"color: rgb(0, 0, 255); background-color: initial;\\\">\'3.jpg\'</code><code style=\\\"color: rgb(0, 0, 0); background-color: initial;\\\">,&nbsp;</code><code style=\\\"color: rgb(0, 0, 255); background-color: initial;\\\">null</code><code style=\\\"color: rgb(0, 0, 0); background-color: initial;\\\">, 0]</code></li><li><code style=\\\"color: rgb(0, 0, 255); background-color: initial;\\\">var</code>&nbsp;<code style=\\\"color: rgb(0, 0, 0); background-color: initial;\\\">newArr = arr.filter(item =&gt; item)</code></li><li><code style=\\\"color: rgb(0, 130, 0); background-color: initial;\\\">// 也可以写成</code></li><li><code style=\\\"color: rgb(0, 130, 0); background-color: initial;\\\">// var newArr = arr.filter(Boolean);</code></li><li><code style=\\\"color: rgb(0, 0, 0); background-color: initial;\\\">console.log(newArr)&nbsp;</code><code style=\\\"c