insert  into `sys_log`(`ID`,`USERNAME`,`OPERATION`,`TIME`,`METHOD`,`PARAMS`,`IP`,`CREATE_TIME`,`location`,`status`,`type`) values (2118,'admin','update操作系统日志','71','com.rains.graphql.system.mutation.NoticeMutation.noticeBaseMutation()',' request: \"QueryRequest(runOrder=0, pageSize=10, pageNum=1, sortField=null, sortOrder=desc, filter=null, opt=update, svc=null, ids=null, data=null, datas=[{noticeId=10, noticeTitle=test1, noticeType=1, noticeContent=<h2>filter() - 过滤,筛选</h2><p class=\\\"ql-align-right\\\">1</p><p><code style=\\\"background-color: initial; color: rgb(0, 0, 255);\\\">var</code>&nbsp;<code style=\\\"background-color: initial; color: rgb(0, 0, 0);\\\">newArr = array.filter((currentValue, index, array) =&gt; {&nbsp;</code><code style=\\\"background-color: initial; color: rgb(0, 0, 255);\\\">return</code>&nbsp;<code style=\\\"background-color: initial; color: rgb(0, 0, 0);\\\">... }, thisValue);</code></p><p><br></p><ul><li>currentValue， 必须，当前的元素值；</li><li>index， 可选，当前元素值的索引；</li><li>array， 可选，原数组；</li><li>thisValue， 可选，对象作为该执行回调时使用，传递给函数，用作 \\\"this\\\" 的值；</li><li>return 新数组；</li></ul><p>栗子：过滤不符合项</p><p class=\\\"ql-align-right\\\">1</p><p class=\\\"ql-align-right\\\">2</p><p class=\\\"ql-align-right\\\">3</p><p class=\\\"ql-align-right\\\">4</p><p class=\\\"ql-align-right\\\">5</p><p><code style=\\\"background-color: initial; color: rgb(0, 0, 255);\\\">var</code>&nbsp;<code style=\\\"background-color: initial; color: rgb(0, 0, 0);\\\">arr = [20,30,50, 96,50]</code></p><p><code style=\\\"background-color: initial; color: rgb(0, 0, 255);\\\">var</code>&nbsp;<code style=\\\"background-color: initial; color: rgb(0, 0, 0);\\\">newArr = arr.filter(item =&gt; item&gt;40)&nbsp;</code></p><p>&nbsp;</p><p><code style=\\\"background-color: initial; color: rgb(0, 0, 0);\\\">console.log(arr)&nbsp;&nbsp;</code><code style=\\\"background-color: initial; color: rgb(0, 130, 0);\\\">// [20,30,50, 96,50]</code></p><p><code style=\\\"background-color: initial; color: rgb(0, 0, 0);\\\">console.log(newArr)&nbsp;&nbsp;</code><code style=\\\"background-color: initial; color: rgb(0, 130, 0);\\\">// [50, 96, 50]</code></p><p>&nbsp;</p><p>高频用途：</p><p><br></p><ol><li>上例中的过滤不符合项；</li><li>去掉数组中的&nbsp;<span style=\\\"color: rgb(255, 0, 0);\\\">空字符串、0、</span>undefined、null；</li><li class=\\\"ql-align-right\\\">1</li><li class=\\\"ql-align-right\\\">2</li><li class=\\\"ql-align-right\\\">3</li><li class=\\\"ql-align-right\\\">4</li><li class=\\\"ql-align-right\\\">5</li><li><code style=\\\"background-color: initial; color: rgb(0, 0, 255);\\\">var</code>&nbsp;<code style=\\\"background-color: initial; color: rgb(0, 0, 0);\\\">arr = [</code><code style=\\\"background-color: initial; color: rgb(0, 0, 255);\\\">\'1\'</code><code style=\\\"background-color: initial; color: rgb(0, 0, 0);\\\">,&nbsp;</code><code style=\\\"background-color: initial; color: rgb(0, 0, 255);\\\">\'2\'</code><code style=\\\"background-color: initial; color: rgb(0, 0, 0);\\\">,&nbsp;</code><code style=\\\"background-color: initial; color: rgb(0, 0, 255);\\\">null</code><code style=\\\"background-color: initial; color: rgb(0, 0, 0);\\\">,&nbsp;</code><code style=\\\"background-color: initial; color: rgb(0, 0, 255);\\\">\'3.jpg\'</code><code style=\\\"background-color: initial; color: rgb(0, 0, 0);\\\">,&nbsp;</code><code style=\\\"background-color: initial; color: rgb(0, 0, 255);\\\">null</code><code style=\\\"background-color: initial; color: rgb(0, 0, 0);\\\">, 0]</code></li><li><code style=\\\"background-color: initial; color: rgb(0, 0, 255);\\\">var</code>&nbsp;<code style=\\\"background-color: initial; color: rgb(0, 0, 0);\\\">newArr = arr.filter(item =&gt; item)</code></li><li><code style=\\\"background-color: initial; color: rgb(0, 130, 0);\\\">// 也可以写成</code></li><li><code style=\\\"background-color: initial; color: rgb(0, 130, 0);\\\">// var newArr = arr.filter(Boolean);</code></li><li><code style=\\\"background-color: initial; color: rgb(0, 0, 0);\\\">console.log(newArr)&nbsp;</code><code style=\\\"background-color: initial; color: rgb(0, 130, 0);\\\">// [\\\"1\\\", \\\"2\\\", \\\"3.jpg\\\"]</code></li><li>数组去重；</li></ol><p>&nbsp;</p><p>注意：</p><p><br></p><ol><li>filter() 不会对空数组进行检测；</li></ol>, status=0, createBy=, createTime=null, updateBy=, updateTime=null}], batchdatas=null, child=null, consumer=null, optMap={})\" env: DataFetchingEnvironmentImpl{executionStepInfo=ExecutionStepInfo{ path=/noticeBaseMutation, type=GraphQLScalarType{name=\'Boolean\', description=\'Built-in Boolean\', coercing=graphql.Scalars$4@2c4514cd}, parent=ExecutionStepInfo{ path=, type=GraphQLObjectType{name=\'Mutation\', description=\'null\', fieldDefinitionsByName=[version, dictDataBaseMutation, dictTypeBaseMutation, genTableBaseMutation, genTableColumnBaseMutation, noticeBaseMutation, postBaseMutation, deptBaseMutation, addDept, updateDept, deleteDepts, deptExport, addDict, updateDict, deleteDicts, dictExport, updateGeneratorConfig, generate, deleteLoginLogs, deleteLogs, exportLogs, exportLoginLogs, logBaseMutation, menuBaseMutation, addMenu, updateMenu, deleteMenus, menuExport, roleBaseMutation, addRole, updateRole, deleteRoles, roleExport, addUser, updateUser, updateProfile, updateAvatar, updatePassword, resetPassword, deleteUsers, updateUserConfig, userExport, userBaseMutation], interfaces=[]}, parent=null, fieldDefinition=null}, fieldDefinition=GraphQLFieldDefinition{name=\'noticeBaseMutation\', type=GraphQLScalarType{name=\'Boolean\', description=\'Built-in Boolean\', coercing=graphql.Scalars$4@2c4514cd}, arguments=[GraphQLArgument{name=\'request\', value=null, defaultValue=null, type=graphql.schema.GraphQLInputObjectType@664083f6}], dataFetcherFactory=graphql.schema.DataFetcherFactories$$Lambda$545/1645805674@3308dd8c, description=\' tableComment 编辑 包括新增、修改、删除\n opt:insert表示新增\n opt:update表示修改\n opt:delete表示删除\', deprecationReason=\'null\', definition=FieldDefinition{name=\'noticeBaseMutation\', type=TypeName{name=\'Boolean\'}, inputValueDefinit